var moveDeer = function(deer) {
    let m = deer.createAnimation('position')  
    m.setKeys([
      { frame: 10, value: deer.position.add(new Vector3(-1, 1, 0)) },
      { frame: 20, value: deer.position.add(new Vector3(-2, 0, 0)) },
      { frame: 30, value: deer.position.add(new Vector3(0, 0, 0)) }
    ])

    deer.startAnimations( [m] )
}
var jumpBackDeer = function(deer) {
    let m1 = deer.createAnimation('position')  
    m1.setKeys([
      { frame: 10, value: deer.position.add(new Vector3(0,1,1)) },
      { frame: 20, value: deer.position.add(new Vector3(0,0,2)) }
    ])
    deer.startAnimations( [m1] )
}



var movePenguin = function(o) {
    let m = o.createAnimation('position')  
    m.setKeys([
      { frame: 10, value: o.position.add(new Vector3(-1, 0, 0)) },
      { frame: 20, value: o.position.add(new Vector3(0, 0 ,0)) }
    ])
    o.startAnimations( [m] )
}

var jump = function(o) {
    let m = o.createAnimation('position')  
    m.setKeys([
      { frame: 10, value: o.position.add(new Vector3(0, 1, 0)) },
      { frame: 20, value: o.position.add(new Vector3(0, 0 , 0)) }
    ])
    o.startAnimations( [m] )
}

var rotate360 = function(o) {
    let m = o.createAnimation('rotation')  
    m.setKeys([ { frame: 10, value: o.rotation.add(new Vector3(0, 2 * Math.PI, 0)) }])
    o.startAnimations( [m] )
}

var jump360 = function(o) {
    let m = o.createAnimation('position')  
    m.setKeys([
      { frame: 10, value: o.position.add(new Vector3(0, 1, 0)) },
      { frame: 20, value: o.position.add(new Vector3(0, 0 , 0)) }
    ])

    let m2 = o.createAnimation('rotation')  
    m2.setKeys([ { frame: 20, value: o.rotation.add(new Vector3(0, 2 * Math.PI, 0)) }])
    o.startAnimations( [m, m2] )
}

var changeLED = function(object, color) {
  object.set({ 'color': color })
}

// - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -

var runSocketMessage = function(data) {

  parcel.getFeatures().forEach((feature) => {

    // the LANTERNS
    if (data.object == "floor" && feature._content.id === 'floor')  {
      changeLED(feature, data.value)
    }
    if (data.object == "column-1" && feature._content.id === 'column-1')  {
      changeLED(feature, data.value)
    }
    if (data.object == "column-2" && feature._content.id === 'column-2')  {
      changeLED(feature, data.value)
    }
    if (data.object == "roof-1" && feature._content.id === 'roof-1')  {
      changeLED(feature, data.value)
    }
    if (data.object == "roof-2" && feature._content.id === 'roof-2')  {
      changeLED(feature, data.value)
    }

    // PENGUINS
    if (data.object == "penguin" && feature._content.id === 'penguin')  {
      if (data.value == "move") { movePenguin(feature) }
      if (data.value == "jump") { jump(feature) }
      if (data.value == "jump360") { jump360(feature) }
    }


    // DEERS
    if (data.object == "deer" && feature._content.id === 'deer')  {
      if (data.value == "move") { moveDeer(feature) }
      if (data.value == "jump") { jump(feature) }
      if (data.value == "jump360") { jump360(feature) }
    } 

    // ICEMAN
    if (data.object == "iceman" && feature._content.id === 'iceman')  {
      if (data.value == "jump360") { jump360(feature) }
      if (data.value == "jump") { jump(feature) }
    } 

  })
}



